import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Header from "./Components/Navbar";
import AboutPage from "./Components/AboutPage";

function App() {

  return (
    <div className="App">
        <Router>
        <Header />

          <Routes>
            <Route path="/" exact element={<AboutPage />}></Route>
          </Routes>
    </Router>

    </div>
  );
}

export default App;
